    async function savePDF(voucher: any) {
        var doc = new jsPDF();
        doc.html(voucher, {
            callback: function (doc) {
                doc.save("Detalle_Pedido_" + venta.DOC_BUSINESS_NAME);
            },
            x: 10,
            y: 5,
            windowWidth: 10,
            width: 2.2,
        });
    }

